window.bookSummaryJSON = "<p>Tom Keeler was done with Alaska, but Alaska wasn’t done with him.</p> <p>After four months working a fishing boat he’s on his way to a permanent vacation. All he wants is to get back to that girl in Seattle, but there are men following him, which doesn’t make much sense.</p> <p>Jane Abrams just got to Alaska and she’s got big problems. Her son has gone missing and the police won’t help. She wants Keeler’s assistance but he’s got other plans.</p> <p>But, when the people pushing Abrams around step over the line, Keeler gets both interested and curious.</p> <p>They thought that owning the town gave them special privileges. But they never planned on coming up against Tom Keeler.</p>"; 
